import Head from 'next/head'

export default function Home() {
  return (
    <div className="container">
      <Head>
        <title>SUPERFLUSH</title>
        <link rel="icon" href="/img/favicon.ico" />
      </Head>

      <main>
        <header>
          <div className="logo">
            <img src="/img/logo.png" />
          </div>
          <div className="hero">
            <h1 className="title">
              <div className="redShadows">SUPER</div>
              <div className="blueShadows">FLUSH</div>
            </h1>

            <div className="separator">
              <div className="redShadows" />
              <div className="blueShadows" />
            </div>
          </div>
        </header>

        <div className="grid">
          <div className="card">
            <div className="leftCompartment">
              <div className="cardSection">
                <ul>
                  <li><a href="#">YOUTUBE</a></li>
                  <li><a href="#">SPOTIFY</a></li>
                  <li><a href="#">APPLE MUSIC</a></li>
                  <li><a href="#">SOUNDCLOUD</a></li>
                </ul>
              </div>
              <div className="cardSection">
                <ul>
                  <li><a href="#">ARTWORK</a></li>
                  <li><a href="#">BLOG</a></li>
                  <li><a href="#">STORE</a></li>
                </ul>
              </div>
            </div>
            <div className="rightCompartment">
              <div className="cardSection">
                <ul>
                  <li><a href="#">INSTAGRAM</a></li>
                  <li><a href="#">ABOUT</a></li>
                </ul>
              </div>
            </div>
          </div>
          <img src="/img/california.jpg" />
        </div>

        {/* <p className="description">
          Get started by editing <code>pages/index.js</code>
        </p>

        <div className="grid">
          <a href="https://nextjs.org/docs" className="card">
            <h3>Documentation &rarr;</h3>
            <p>Find in-depth information about Next.js features and API.</p>
          </a>

          <a href="https://nextjs.org/learn" className="card">
            <h3>Learn &rarr;</h3>
            <p>Learn about Next.js in an interactive course with quizzes!</p>
          </a>

          <a
            href="https://github.com/vercel/next.js/tree/master/examples"
            className="card"
          >
            <h3>Examples &rarr;</h3>
            <p>Discover and deploy boilerplate example Next.js projects.</p>
          </a>

          <a
            href="https://vercel.com/import?filter=next.js&utm_source=create-next-app&utm_medium=default-template&utm_campaign=create-next-app"
            className="card"
          >
            <h3>Deploy &rarr;</h3>
            <p>
              Instantly deploy your Next.js site to a public URL with Vercel.
            </p>
          </a>
        </div> */}
      </main>

      <style jsx>{`
        @font-face {
          font-family: "Acens";
          src: url("/fonts/Acens.ttf") format("truetype");
        }

        @font-face {
          font-family: "Space Mono";
          src: url("/fonts/Space_Mono/SpaceMono-Regular.ttf") format("truetype");
        }

        @font-face {
          font-family: "Space Mono";
          src: url("/fonts/Space_Mono/SpaceMono-Bold.ttf") format("truetype");
          font-weight: bold;
        }

        a, p, h1, h2, h3, h4, h5, h6 {
          font-family: "Space Mono";
        }

        .container {
          min-height: 100vh;
          padding: 0 0.5rem;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          background: orange;
        }

        main {
          flex: 1;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          background: blue;
          width: 90%;
        }

        a {
          color: inherit;
          text-decoration: none;
        }

        header {
          background: lightgrey;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: flex-start;
          width: 60%;
        }

        .logo {
          background: black;
          align-self: flex-end;
        }

        .logo > img {
          background: green;
          width: 3rem;
          height: 3rem;
          vertical-align: middle;
        }

        .hero {
          background: grey;
        }

        .title {
          font-size: 6rem;
          font-family: Acens;
          text-align: center;
        }

        .title > div {
          background: none;
          display: inline-block;
        }

        .redShadows {
          background-color: rgba(255, 64, 0, 0.75);
          color: rgba(255, 64, 0, 0.75);
          filter:
            drop-shadow(-5px -5px 0 rgba(255, 128, 0, 0.75))
            drop-shadow(-5px -5px 0 rgba(255, 255, 0, 0.75));
        }

        .blueShadows {
          background-color: rgba(0, 64, 255, 0.75);
          color: rgba(0, 64, 255, 0.75);
          filter:
            drop-shadow(-5px -5px 0 rgba(0, 128, 255, 0.75))
            drop-shadow(-5px -5px 0 rgba(0, 255, 255, 0.75));
          margin: 1rem 0rem 0rem 1rem;
          vertical-align: -1rem;
        }

        .separator {
          text-align: center;
        }

        .separator > div {
          width: 125%;
          height: 10px;
        }

        code {
          background: #fafafa;
          border-radius: 5px;
          padding: 0.75rem;
          font-size: 1.1rem;
          font-family: Menlo, Monaco, Lucida Console, Liberation Mono,
            DejaVu Sans Mono, Bitstream Vera Sans Mono, Courier New, monospace;
        }

        .grid {
          display: flex;
          flex-direction: row;
          margin-top: 3rem;
          justify-content: center;
          align-items: center;
          width: 100%;
          background: lightgrey;
        }

        .grid > div {
          margin: 2rem;
          background: yellow;
          opacity: 0.75;
        }

        .grid > img {
        }

        .card {
          width: 100%;
          height: 530px;
          display: flex;
        }

        .leftCompartment {
          flex-direction: row;
          background: red;
          justify-content: flex-start;
        }

        @media (max-width: 600px) {
        }
      `}</style>

      <style jsx global>{`
        html,
        body {
          padding: 0;
          margin: 0;
          font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
            Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
            sans-serif;
        }

        * {
          box-sizing: border-box;
        }
      `}</style>
    </div>
  )
}
